import React from "react";
import './index.css';
import {
    Link,
    NavLink,
    BrowserRouter as Router
} from "react-router-dom";

import Signup from "./Signup.js";

function HPNavBar(){
    return(
        <div className="navBar" id="homePageNB">
            <ul id="hpURLList">
                <li>Virtual Version</li>
                <li className="nvUpperRightOptions"><a href="/login"><button>Log in</button></a></li>
                <li className="nvUpperRightOptions"><a href="https://www.google.com/"><button>Sign up</button></a></li>
            </ul>
        </div>
      
    );
}

export default HPNavBar;
